        React.createElement('div', null),
        React.createElement('img', { src: require('../assets/ic_messenger.png') }),
        React.createElement(
            'p',
            null,
            'Message'
        ),
        React.createElement('img', { src: require('../assets/ic_messenger.png') }),
        React.createElement(
            'p',
            null,
            'Save '
        ),
        React.createElement('img', { src: require('../assets/ic_messenger.png') }),
        React.createElement(
            'p',
            null,
            'Share'
        )
    );
}

export default AskForDetailsComponent;
